import React from 'react'

const PokeCard = props => {
    return(
        <>
        <div>
            <h3>{props.name}</h3>
            <p>Ataque</p>
        </div>
          <div>
          <div>Una cuenta de prueba: {this.state.count}</div>
          <input
            type="text"
            value={this.state.count}
            onChange={this.handleInput}
          >
          </input>
        </div>
    </>
    );
}

export default PokeCard;
